import "./App.css";
import "react-toastify/dist/ReactToastify.css";
import "aos/dist/aos.css";

import AOS from "aos";
import Routers from "./router";

AOS.init();

function App() {
  return (
    <>
      <Routers />
      <ToastContainer />
    </>
  );
}

export default App;
